class Solution:
    # @param A : string
    # @return an integer
    
    def get_min(self,i,A,DIR):
        if DIR == 'L':
            for ind in range(len(A[:i+1])-1,-1,-1):
                #print('loop left in get min :: '+str(A[ind]))
                if A[ind] == 'o':
                    return abs(ind-i)
                
            return len(A)

        elif DIR == 'R':
            for ind in range(len(A[i:])):
                #print('loop right in get min :: '+str(A[ind]))
                if A[ind] == 'o':
                    return abs(ind-i)
            return len(A)


                
    def solve(self, A):
        min_dif = len(A)
        a_len = len(A)
        x_min = None
        o_min = None
        for i,val in enumerate(A):
            #print('main loop :: ' + str(i)+'  :: '+str(val))
            if val == 'x':
                l_min = self.get_min(i,A,'L')
                #print(l_min)
                r_min = self.get_min(i,A,'R')
                #print(r_min)
                if l_min  < r_min and l_min < min_dif:
                    min_dif = l_min
                elif r_min < min_dif:
                    min_dif = r_min  
                #print('MIN_DIFF :: '+str(min_dif))
        return min_dif
                


